import React from "react";
import { BrowserRouter as Switch,Route,Router } from "react-router-dom";

import HomePage from "./components/HomePage/HomePage";

function App() {
  return (
    <div>
    <Router>
      <Switch>
        <Route exact path="/"><HomePage /></Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
